


SELECT CASE WHEN COUNT(1) > 0 THEN 'FAILURE' ELSE 'SUCCESS' END AS Result , CASE WHEN COUNT(1) > 0 THEN 'Pass through columns from DS_SURVEY_QUESTION to D_SURVEY_QUESTION did not match' ELSE 'SUCCESS' END AS Message FROM <<tenant>>_mdwdb.ds_survey_question WHERE CRC32(CONCAT( IFNULL(row_id,''), IFNULL(source_id,''), IFNULL(active_flag,''), IFNULL(question,''), IFNULL(question_order,''), IFNULL(min_value,''), IFNULL(max_value,''), IFNULL(question_type_src_code,''), IFNULL(updated_count,''), IFNULL(soft_deleted_flag,''), IFNULL(created_by,''), IFNULL(changed_by,''), IFNULL(created_on,''), IFNULL(changed_on,''))) NOT IN (SELECT CRC32(CONCAT( IFNULL(row_id,''), IFNULL(source_id,''), IFNULL(active_flag,''), IFNULL(question,''), IFNULL(question_order,''), IFNULL(min_value,''), IFNULL(max_value,''), IFNULL(question_type_src_code,''), IFNULL(updated_count,''), IFNULL(soft_deleted_flag,''), IFNULL(created_by,''), IFNULL(changed_by,''), IFNULL(created_on,''), IFNULL(changed_on,''))) FROM <<tenant>>_mdwdb.d_survey_question)
